package com.c702t.Cerveza.models.request;

import com.c702t.Cerveza.auth.utility.RoleEnum;
import com.c702t.Cerveza.models.entity.RoleEntity;
import io.swagger.annotations.ApiModel;
import io.swagger.annotations.ApiModelProperty;
import lombok.*;

import javax.persistence.*;
import javax.validation.constraints.*;
import java.util.Set;

@Setter
@Getter
@AllArgsConstructor
@NoArgsConstructor
@ApiModel(description = "Class representing an User Request.")
public class UserRequest {

    @NotNull(message = "the firstName can't be null")
    @NotEmpty(message = "the firstName can't be empty")
    @NotBlank(message = "the firstName can't  be blank")
    @ApiModelProperty(notes = "First name of the User.", example = "Alejandro", required = true)
    private String firstName;

    @NotNull(message = "the lastName can't be null")
    @NotEmpty(message = "the lastName can't be empty")
    @NotBlank(message = "the lastName can't  be blank")
    @ApiModelProperty(notes = "Last name of the User.", example = "Lopez", required = true)
    private String lastName;

    @NotNull(message = "the email can't be null")
    @Email(message = "the email is not valid")
    @ApiModelProperty(notes = "Email of the User.", example = "am@mail.com", required = true)
    private String email;

    @NotNull(message = "the password can't be null")
    @NotEmpty(message = "the password can't be empty")
    @NotBlank(message = "the password can't  be blank")
    @ApiModelProperty(notes = "Password of the User.", example = "1234", required = true)
    private String password;

    @NotNull(message = "the confirmPassword confirm can't be null")
    @NotEmpty(message = "the confirmPassword confirm can't be empty")
    @NotBlank(message = "the confirmPassword confirm can't  be blank")
    @ApiModelProperty(notes = "confirmPassword of the User.", example = "1234", required = true)
    private String confirmPassword;

    private String rol;

//    @ApiModelProperty(notes = "Photo encoded in Base64 of the User.", example = "data:image/png;base64,")
//    private String photo;

}